import React from 'react';
import { Form } from 'antd';

export const NicknameEditform = () => {
  const [form] = Form.useForm();

  const onSubmit = () => {};

  return (
    <Form
      form={form}
      onFinish={onSubmit}>
      <Form.Item />
    </Form>
  );
};

export default null;
